import React from "react";
import Card from "../Card/Card";
function Overview() {
  return (
    <div>
      <Card num={69} solve={"Unresolved"} />
      <Card num={16} solve={"Overdue"} />
      <Card num={43} solve={"Unresolved"} />
      <Card num={69} solve={"Unresolved"} />
    </div>
  );
}

export default Overview;
